import React, { cloneElement } from "react";

import Indecision from "../assets/images/Indecision.png";
import clone from "../assets/images/clone.png";
import Mroom from "../assets/images/Mroom.jpg";

class Carousel extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      items: [
        {
          id: 0,
          title: "Indecision App",
          subtitle: "The Decision Control App",
          imgSrc: Indecision,
          link: "www.github.com",
          selected: false,
        },
        {
          id: 0,
          title: "U",
          subtitle: "Monster Game with Vue.js App",
          imgSrc: clone,
          link: "www.github.com",
          selected: false,
        },
        {
          id: 0,
          title: "My MRoom",
          subtitle: "The My MRoom Webpage",
          imgSrc: Mroom,
          link: "www.github.com",
          selected: false,
        },
      ],
    };
  }
  render() {
    return <p>Carousel works</p>;
  }
}
export default Carousel;
